INSERT INTO `news` (`id`, `zagolovok`, `news`, `author`, `date`, `PicH`, `like`) VALUES
(1, 'Обновление автошколы', 'По просьбам работников автошколы, мы официально убираем покупку лицензий из доната.<br>\nТеперь Вам придется ездить, и сдавать права самим но и эту систему мы не оставили без внимания.<br>\nТеперь сдача экзамена на права стала более удобной, сначала вы читаете все правила потом сдаете тест после выбираете пункт сдачи экзамена:<br><br>\n\n1) Через инструктора<br>\n2) Автоматический экзамен 100.000$ (платный)<br>\n\nТакже добавили новые команды для инструкторов:<br><br>\n\n/givelic - Выдать лицензии; <br>\n/skipexam - Выгнать из очереди на экзамен;<br>\n/exam - Провести экзамен;<br>', 'Valera_Trefilov', '2015-08-20', 'https://pp.vk.me/c628522/v628522874/100c5/tOdO4fYvukg.jpg', 147),
(2, 'Риэлторские компании', '<p>Здравствуйте, уважаемые игроки нашего сервера! <br>\r\nСегодня я расскажу Вам о долгожданном обновлении, а именно обновление, которое вводит в игру риэлторскую компанию.<br> \r\nТеперь находить нужный дом стало намного проще, Вы больше не будете бегать по карте и искать свободный дом и покупать "кота в мешке". <br>Теперь это делается намного проще.<br>\r\nХотите купить дом? <br>\r\nПриезжаем в риэлторскую компанию, смотрим количество свободных домов и их номера, далее подходим к специальному маркеру, в диалоговое окно вводим номер желаемого дома. <br>\r\nВам будет предоставлена вся необходимая информация об этом доме, так же можно будет полностью его осмотреть. <br>Для удобной навигации используйте команду /chome, она покажет на радаре нужный Вам дом. <br>\r\nЗабудьте о долгих поисках свободных домов, покупке без осмотра. <br>Хватит ловить удачу за хвост! <br>\r\nС этим долгожданным обновлением игра на нашем сервере станет не только реалистичнее, но и позволит упростить игру для Вас!<br>\r\nНайти данный вид бизнеса вы сможете в /gps</p>', 'Valera_Trefilov', '2015-10-26', 'https://pp.vk.me/c623928/v623928874/51b79/B4f5V1e6FzI.jpg', 174),
(4, 'Новый год!', '<p>Уважаемые игроки, скоро наступает новый год.<br>И специально для этого мы оборудовали для Вас сцену, и развлекательные условия для приятного времяпровождения. <br><br>Вливайся в нашу семью прямо сейчас !<br>IP: 176.32.36.115:7777</p>', 'Valera_Trefilov', '2015-12-17', 'https://pp.vk.me/c627824/v627824288/292ae/OBwbBMHllJ8.jpg', 238),
(5, 'Система камер для ПД', '<p>\r\n	Дорогие друзья, представляю вашему вниманию систему наблюдения для полиции штата с помощью камер !<br>\r\n	<br>\r\n	Уникальность этого обновления состоит в полной динамичности системы, ведь каждый патрульный может теперь без труда наблюдать за порядком штате, где бы он не находился.<br>\r\n	<br>\r\n	Итак, для того чтобы создать точку наблюдения:<br>\r\n	- Введите команду /camera и выберите пункт &quot;CREATE POINT&quot;.<br>\r\n	- Затем, настройте камеру на Ваше усмотрение, и нажмите ENTER.<br>\r\n	- В меню у вас появится порядковый номер точки наблюдения, нажав на него вы сможете наблюдать за тем местом в котором вы поставили точку, а также приближать (кнопка Y) или же отдалять (кнопка N), чтобы закончить наблюдать нажмите ENTER.<br>\r\n	- Максимальное количество точек наблюдения по пять штук на одного игрока.<br>\r\n	- Для того чтобы удалить точку наблюдения нажимайте H.<br>\r\n	<br>\r\n	Данное обновление, облегчит работу сотрудникам ПД в штате. Следите за обновлениями в группе, и спасибо за то что вы с нами.<br>\r\n<div class="image">\r\n	<img alt="E5ecDvO9_WA.jpg" src="https://pp.vk.me/c627630/v627630874/420f4/E5ecDvO9_WA.jpg"></div><br>\r\n	<div class="image"><img alt="qjuO0cRaJrs.jpg"  src="https://pp.vk.me/c627630/v627630874/42104/qjuO0cRaJrs.jpg"></div>\r\n</p>\r\n', 'Valera_Trefilov', '2016-03-14', 'https://pp.vk.me/c627630/v627630874/42104/qjuO0cRaJrs.jpg', 530),
(6, 'Новая система стрел за бизнес и /members', '<p>\r\n	Уважаемые игроки , чтобы разнообразить игру мафиози на сервере , было принято решение убрать битвы за территории и вернуть войны за бизнесы ( /bizwar ) .<br>\r\n	<br>\r\n	Но вернули мы его улучшенным , не стали ограничиваться только тремя зонами для проведения стрел . Теперь при захвате бизнеса игрок сам выбирает точку на карте где будет проходить стрела .<br>\r\n	<br>\r\n	Также улучшен /members организаций , доступен просмотр игроков организации онлайн не только в диалоге , но и по карте , для удобства просмотра где находится игрок .\r\n</p>\r\n<div class="image">\r\n	<img alt="oo8zWbv76rk.jpg" class="ipsImage" src="https://pp.vk.me/c631716/v631716874/1b467/oo8zWbv76rk.jpg">\r\n</div>\r\n\r\n<div class="image">\r\n	<img alt="uYJ1ic2YLlo.jpg" class="ipsImage" src="https://pp.vk.me/c631716/v631716874/1b470/uYJ1ic2YLlo.jpg">\r\n</div>', 'Valera_Trefilov', '2016-03-15', 'https://pp.vk.me/c631716/v631716874/1b479/1K0qxa9KUrk.jpg', 456),
(7, 'Обновление для сотрудников гос. департамента', '<p>\r\n	На этой неделе мы кардинально занимались улучшением гос. структур, нам удалось поменять вектор разработок обновлений, что и привело к данным обновлениям.<br>\r\n	<br>\r\n	Итак, начнём:<br>\r\n	<br>\r\n	- Для &quot;Национальной гвардии&quot; был добавлен тир, где вы можете увеличить свои навыки стрельбы. Стоимость одного сеанса - $10.000. Один сеанс длится 5 минут. Для начала сеанса встаньте на маркер. Стреляйте по мишеням, с каждой убитой мишенью ваш уровень стрельбы увеличивается.<br>\r\n	<br>\r\n	- Добавлена фракция San Andreas Sheriff Department. Она находится в городке Dillimore, возле Los Santos.<br>\r\n	<br>\r\n	- Полиция Los Santos теперь имеет новое название - San Andreas Police Department.<br>\r\n	<br>\r\n	- Возвращена фракция Hostage Rescue Team.<br>\r\n	<br>\r\n	- Добавлена новая система оглушения игрока для гос. организаций. Достаточно взять в руки оружие и ввести команду /tazer, и зарядить своё оружие парализующими патронами, после выстрела в игрока он будет оглушен, а надеть на него наручники вы можете нажав &quot;N&quot;<br>\r\n	<br>\r\n	- Возвращён /f чат для гос. организаций. Теперь сотрудники гос. служб могут координировать друг друга.&nbsp;<br>\r\n	<br>\r\n	Остальные обновления:<br>\r\n	<br>\r\n	- Добавлена новая мера наказания, такая как читерский мир.<br>\r\n	<br>\r\n	- Разделён чат личных сообщений, теперь /sms - это IC чат, а /pm - это ООС чат.<br>\r\n	<br>\r\n	- Исправлены все баги с /break , домами и прочее.<br>\r\n	<br>\r\n	И это еще не все. Скоро вас ожидает очередная волна обновлений. Ставьте лайк и заходите на наш сервер.<br>\r\n	<br>\r\n	Так же вы можете рассказать о своих идеях на нашем форуме, и лучшие из них будут воплощены на сервере.<br>\r\n	<br>\r\n	С уважением, команда World Role Play.<br>\r\n	Каждый из вас очень важен для нас. <br>\r\n	<br>\r\n	IP: 176.32.36.115:7777<br>\r\n	<br>\r\n</p>\r\n\r\n<p>\r\n	<div class="image">\r\n		<img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c630730/v630730874/253fd/mNsfnaxx2sY.jpg">\r\n	</div>\r\n</p>\r\n\r\n<p>\r\n	<div class="image">\r\n		<img alt="VZv7PPRzfpE.jpg" src="https://pp.vk.me/c630730/v630730874/25406/VZv7PPRzfpE.jpg">\r\n	</div>\r\n</p>\r\n\r\n\r\n<p>\r\n	<div class="image">\r\n		<img alt="Z05Hf00v1QI.jpg" src="https://pp.vk.me/c630730/v630730874/25410/Z05Hf00v1QI.jpg">\r\n	</div>\r\n</p>\r\n\r\n\r\n\r\n<p>\r\n	<div class="image">\r\n		<img alt="3uOQppNPCso.jpg" src="https://pp.vk.me/c630730/v630730874/2541a/3uOQppNPCso.jpg">\r\n	</div>\r\n</p>\r\n\r\n\r\n<p>\r\n	<div class="image">\r\n		<img alt="0LIIrsfeFOU.jpg" src="https://pp.vk.me/c630730/v630730874/25424/0LIIrsfeFOU.jpg">\r\n	</div>\r\n</p>\r\n\r\n\r\n<p>\r\n	<div class="image">\r\n		<img alt="HFFx4M0aO_c.jpg" src="https://pp.vk.me/c630730/v630730874/2542e/HFFx4M0aO_c.jpg">\r\n	</div>\r\n</p>\r\n', 'Valera_Trefilov', '2016-04-03', 'https://pp.vk.me/c630730/v630730874/25406/VZv7PPRzfpE.jpg', 436),
(8, 'Новый интерьер 24/7.', '	<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c636825/v636825907/5944/SAlz_s7Dpi0.jpg"></div></p>\r\n	<p><div class="image">	<img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c636825/v636825009/75fc/ZkhyYvGGxcM.jpg"></div></p>', 'Valera_Trefilov', '2016-05-10', 'https://pp.vk.me/c636825/v636825498/9f49/Jg00XuhICrw.jpg', 37),
(10, 'Поворотники и система дропа оружия', '\r\n<p>Обновления на [05.05.2016]<br><br>- Так как в гетто мы решили убрать ДМ, но есть такие игроки которые любят пострелять в гетто, то мы решили сделать для них систему PVP между бандитами, суть очень проста: вводите команду /pvp [id игрока] [оружие] , и проводите так называемый дуэль, система переместит вас в виртуальный мир, чтобы дуэль проходил без помех, по окончанию дуэля в чат напишет имя победителя и вернет вас обратно.<br><br>- Система семей также была исправлена, сделан полный вайп семей (потому-что многие были не в своих семьях). А также создание семей теперь доступно с 6 уровня.<br>- По многочисленным просьбам, изменена система времени на сервере. Теперь на сервере игровое время, и получается за один ООС день, вы проживаете два IC дня. 12 часов ООС дня - это 24 часа IC дня.<br>- Добавлена система таргета, теперь если вы стреляете издали то будет удобно смотреть за состоянием противника.<br>- Исправлена команда /ado, /caraction (не должна пропадать).<br>- Добавлена динамическая система выброса оружия. Команды: /dropgun, /dropguns. Также после того как вы умираете с оружием, то ваше оружие выпадает и его подобрать. Когда вы выкидываете одно оружие, позицию оружия можно редактировать, для большей реалистичности.<br>- Для соблюдения правил ПДД, добавлены ограждения на шоссе СФ-ЛС. А также добавлена система поворотников, чтобы их использовать нажмите NUM4 - NUM6.<br><br>Также написано еще достаточное количество обновлений, но выпускать их будем постепенно. <br>Ставь ❤ и следующее обновление выйдет быстрее</p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c629413/v629413874/4aaee/Qvk1IjEtWFk.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c629413/v629413874/4aaf6/PSLJKscxZMw.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c629413/v629413874/4aaff/DY3DZfr7gUI.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c629413/v629413874/4ab07/pxwsjLY4Ybg.jpg"></div></p>', 'Valera_Trefilov', '2016-05-05', 'https://pp.vk.me/c630324/v630324848/28ed5/Jt5vXIAkPSg.jpg', 38),
(11, 'Уникальный интерьер фбр', '<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c604322/v604322147/8a3c/_07t3Z6-9x8.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c604322/v604322933/96bc/dmkkHJ2Ja50.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c604322/v604322388/9ad5/oAjMfxI_-BY.jpg"></div></p>', 'Valera_Trefilov', '2016-05-12', 'https://pp.vk.me/c604322/v604322708/9ea2/60Md3AaBCO4.jpg', 32),
(12, 'лучшая Система аксессуаров в самп ', '<p>Обновление системы аксессуаров.<br><br>В отличии от той системы которая у нас была ранее, в этом обновлении удалось воспроизвести все те черты так сказать идеального магазина аксессуаров, который был запланирован. Иными словами мы его сделали максимально удобным и красивым для покупки и использования.<br><br>Мы заменили интерьер самого магазина, что придало атмосферу. Также само меню выполнено на текстдравах что исключит лишние нажатия по диалогам, и вы сразу кликаете на то что вам нужно. <br><br>Сама камера направляется туда куда нужно, и выбирать аксессуар не составляет труда, вы сразу видите как сидит на вас тот или иной аксессуар, также можно редактировать позицию аксессуара перед покупкой и после покупки. <br><br>Приобретенные аксессуары хранятся в инвентаре /inv . Там вы можете снять, одеть, изменить, удалить аксессуары. <br><br>Данный ремейк этого магазина лишь путь к полной деформации сервера на удобство игроков.  Если тебе это нравится ставь ❤</p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c633421/v633421874/28020/bRBxjEGmqxQ.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c633421/v633421874/2802a/cUFRSms5ysI.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c633421/v633421874/28034/95I6FTx-8ds.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c633421/v633421874/2803e/ubgM6kVmtbs.jpg"></div></p>', 'Valera_Trefilov', '2016-05-11', 'https://pp.vk.me/c633421/v633421874/28016/oDrFL4lQyUw.jpg', 217),
(13, 'открытие сёрфинг клуба', '<p>С каждым днём, наш сервер становиться лучше. И это обновление лишь доказательства этих слов. Итак, обновление - "Серфинг Клуб" !<br><br>Так как скоро наступает лето, вы можете ощутить его на сервере. Найти клуб можно в /gps &gt; Развлечения. Там будут стоять продавцы и у них можно приобрести доску, после чего нужно подойти к воде у берега и стать на доску (/surf) , после чего можно начинать кататься. Если вы покинете пляжную зону то у вас будет пропадет доска.<br><br>Управление доской: влево , вправо , вниз , вверх обычными стрелками.<br>Надеюсь данное обновление приукрасит и разнообразит вашу жизнь.</p>\r\n\r\n\r\n\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c626223/v626223874/9cbd/BIHczXA6G-A.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c626223/v626223874/9cc7/2dO0tBXVtao.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c626223/v626223874/9cd1/8VZnn9UvUtk.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c626223/v626223874/9cdb/3oiScEchdls.jpg"></div></p>', 'Valera_Trefilov', '2016-05-16', 'https://pp.vk.me/c626223/v626223874/9cb3/L4q0tgAUH0o.jpg', 215),
(14, 'система смерти ', '<p>Продолжаем также вводить необычные обновления и на этот раз у нас - "Система смерти" !<br><br>Теперь если в вас попадают и ваш уровень здоровья меньше чем урон от оружия, то у вас начинается первая стадия смерти. Во время этой стадии у вас начинается головокружение и вы не можете идти, вылечится вы можете аптечкой или вызовите медика.<br><br>После еще одного "контрольного" выстрела, вы окончательно теряете сознание и начинается идти таймер, так сказать последние секунды вашей жизни, вылечится аптечкой вы не можете, но вас все еще может спасти медик. После окончания таймера, вы появляетесь в больнице. <br><br>Данное обновление, придаст реалистичности нашему серверу.<br>С уважением, команда World-RP.</p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c630323/v630323331/2fd6d/0fJeD2e3ih4.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c630323/v630323486/32755/QCZEYipOB-g.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c630323/v630323884/376c1/usA4VEbgD_o.jpg"></div></p>\r\n<p><div class="image"><img alt="mNsfnaxx2sY.jpg" src="https://pp.vk.me/c630323/v630323490/340ff/NDz6CaP2LWw.jpg"></div></p>', 'Valera_Trefilov', '2016-05-23', 'https://pp.vk.me/c630323/v630323492/2e548/U5-bPvFbX5E.jpg', 267);
